import React from 'react';
import Blog from './Blog';

function Blogs({ blogs }) {
  if (!blogs || !blogs.length) {
    return <p>Нет блогов для отображения</p>;
  }

  return (
    <div>
      <h2>Список блогов</h2>
      <ul className=''>
        {blogs.map((blog, index) => (
          <li key={index}>
            <Blog blog={blog} />
          </li>
        ))}
      </ul>
    </div>
  );
}

export default Blogs;
